import React, { Component } from 'react';
import './footer.css';

class Footer extends Component {
    state = {  }
    render() { 
        return ( 
            <React.Fragment>
                <div className="footer">
                    <div className="container">
                        <div className="name col-2">
                            <h1>Lettuce</h1>
                            <p></p>
                        </div>

                    </div>
                </div>
            </React.Fragment>

         );
    }
}
 
export default Footer;
